import styled from "styled-components";
import { Page } from "./styles";

const NameBanner = styled.div`
  text-align: center;
  height: 30rem;
  align-content: center;
`;

export const Home = () => {
  return (
    <Page>
      <NameBanner>
        <h1>Welcome!</h1>
      </NameBanner>
    </Page>
  );
};
